import React, { Component } from 'react'

export default class StateProps extends Component {
    constructor(props){
        super(props);
        this.state = {
            makanan : 'Bakso'
        }
    }
    render() {
        return (
            <div>
                <h2>{this.state.makanan}</h2> 
            </div>
        )
    }
}
